import React from 'react';
import './App.css';


function App() {
  return (
    <div className="App">
        <header className="App-header">
            <h1>React Clock</h1>
            <h2>It is {new Date().toLocaleTimeString()}.</h2>
        </header>   
    </div>

  );
}

export default App;
